import { Stack, Box } from "@mui/material";
import { VideoCard, ChannelCard } from './';

const VideosComp = ({ vidoes }) => {
  return (
    <Stack
        direction='row'
        flexWrap='start'
        gap={2}
    >
        {vidoes.map((item, idx)=> (
            <Box key={idx}>
                {item.id.videoId && <VideoCard video={item}/>}
                {item.id.channelId && <ChannelCard channelDetail={item}/>}
            </Box>
        ))}
    </Stack>
  )
}

export default VideosComp
